def visualizResults(result1, result2, result3, result4, result5, avgOccup1, lastpoints, kDep, kHop, kDesorb, timeStart, timeEnd, size):
    x = np.linspace(timeStart, timeEnd, 1000)
    y = (((size*kDep)/kDesorb) * (1-1/(np.exp(kDesorb*x))))/size
    
    constantlimit = []
    for i in range(0,len(x)):
        constantlimit.append(((size*kDep)/kDesorb)/size)
    
    plt.plot(x, y, '-', linewidth = 3, color= "black", label = "analytical solution")
    plt.plot(x, constantlimit, '--', linewidth = 3, color="orange", label = f"analytical limit (= {((size*kDep)/kDesorb)/size})")

    plt.plot(time1, result1, linewidth=3, label = "occupancy 1")
    plt.plot(time2, result2, linewidth=3, label = "occupancy 2")
    plt.plot(time3, result3, linewidth=3, label = "occupancy 3")
    plt.plot(time4, result4, linewidth=3, label = "occupancy 4")
    plt.plot(time5, result5, linewidth=3, label = "occupancy 5")

    plt.title(f"\nkDeposition = {kDep} [1/s], \nkHopping = {kHop} [1/s], \nkDesorption = {kDesorb} [1/s]")
    plt.axis([0, 1, 0, 0.5])
    plt.xlabel('time t [s]', fontsize=20)
    plt.legend(loc="lower right", fontsize=20)
    plt.ylabel('share of occupied places [-]', fontsize=20)
    plt.suptitle(f'Occupancy of a quadratic lattice with size {size} x {size} \n, averaged', fontsize=20)
    plt.grid(True)
    
    plt.show()


